const BookList = ({ books }) => {
	return (
		<table className="book-list">
      <tbody>
  			{books.map((book) => (
          <tr>
    				<td><img className="book-cover" src={book.image}/></td>
    				<td><p>{book.name} ({book.year})</p></td>
    				<td>
            {book.genre.map((genre, index) => (
    					<p key={genre}>
    						{genre}
    						{index !== book.genre.length - 1 && ", "}
    					</p>
    				))}
            </td>
    				<td><p>{book.rating}</p></td>
          </tr>
  			))}
      </tbody>
		</table>
	);
};

export default BookList;
